CREATE DATABASE /*!32312 IF NOT EXISTS*/`defect_db` /*!40100 DEFAULT CHARACTER SET latin1 */;

USE `defect_db`;

/*Table structure for table `defect` */

DROP TABLE IF EXISTS `defect`;

CREATE TABLE `defect` (
  `id` varchar(32) NOT NULL COMMENT 'id',
  `projid` int(11) NOT NULL COMMENT '项目id',
  `atprojstate` tinyint(3) NOT NULL DEFAULT '4' COMMENT '所处项目状态 2：需求、3：设计、4：开发、5：测试、6：实施、7：维护',
  `module` varchar(100) NOT NULL COMMENT '模块',
  `tester` varchar(32) NOT NULL COMMENT '测试人员',
  `handler` varchar(32) NOT NULL COMMENT '当前处理人',
  `type` tinyint(3) NOT NULL DEFAULT '1' COMMENT '缺陷类型：1：缺陷、2：优化、3：建议、4：需求',
  `seriousness` tinyint(3) NOT NULL DEFAULT '2' COMMENT '严重性：1：非常严重、2：比较严重、3：一般、4：轻微',
  `priority` tinyint(3) NOT NULL DEFAULT '1' COMMENT '优先级：1：立即解决、2：高优先级、3：正常处理、4：低优先级',
  `recurrencerate` tinyint(3) NOT NULL DEFAULT '100' COMMENT '复现率 0%、5%、10%...100%',
  `state` varchar(15) NOT NULL DEFAULT 'new' COMMENT '缺陷状态：new：新建、open：打开、assigned：已指派、fixed：已修复、rejectd:拒绝、deferred:延期、reopen：从新打开、closed：关闭',
  `step` text NOT NULL COMMENT '操作步骤',
  `actualresult` varchar(300) DEFAULT NULL COMMENT '实际结果',
  `expectresult` varchar(300) DEFAULT NULL COMMENT '预期结果',
  `remark` varchar(300) DEFAULT NULL COMMENT '备注',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `projid` (`projid`),
  KEY `tester` (`tester`),
  KEY `handler` (`handler`),
  KEY `createtime` (`createtime`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='缺陷信息表';

/*Data for the table `defect` */

insert  into `defect`(`id`,`projid`,`atprojstate`,`module`,`tester`,`handler`,`type`,`seriousness`,`priority`,`recurrencerate`,`state`,`step`,`actualresult`,`expectresult`,`remark`,`createtime`) values ('1670cfefd5ba4189ac7a35be23d320ac',1,4,'出差管理','tester1','tester1',1,2,2,100,'closed','1、用员工账号登录办公自动化系统。\r\n2、点击出差管理，添加出差相关信息，并点击保存，提示添加成功。\r\n3、在列表页未查询到刚刚录入的出差信息。','添加出差信息提示成功，但在列表页查询不到。','出现信息添加成功，并且可以在列表页查询到。','无','2020-10-31 11:24:33'),('18e1cca740f1470aae47b423d3321399',1,4,'用户管理','tester2','tester2',1,2,2,100,'closed','1、用员工账号登录系统。\r\n2、点击用户管理菜单后报404页面。','用户管理菜单报404。','点击用户管理菜单可以正常显示内容。','','2020-10-31 16:56:43'),('901cebc6e21746288ae7bc0f97b170f7',1,4,'用户管理','tester2','tester2',2,3,3,45,'closed','1、用员工账号登录办公自动化系统\r\n2、点击用户管理，修改用户信息，修改头像后保存，提示保存成功。\r\n3、在预览页发现头像并没有变化。\r\n4、退出系统后，再次用相同账号登录。\r\n5、发现头像已经发生变化。','修改头像后，在预览页不生效，需要重新登录后才生效。','修改头像后可以直接反应到预览页。','无','2020-10-31 16:38:17'),('ec6579f155ba4d7299770f947019fd75',2,4,'客户管理','tester1','tester1',1,2,2,100,'closed','1、用销售账号登录CRM管理系统。\r\n2、首页顶部图片错位。','CRM首页顶部图片错位。','CRM首页顶部图片可以正常显示。','','2020-10-31 17:05:15'),('ed9cad817f7f4e00893e18b3c1f2474f',2,4,'客户管理','tester1','tester1',1,2,2,100,'closed','1、用销售账号登录CRM管理系统。\r\n2、点击客户管理菜单，直接出现报错页面。','点击客户管理菜单页面报错。','点击客户管理菜单可以正常显示客户列表页。','无','2020-10-31 16:49:46');

/*Table structure for table `defect_deal` */

DROP TABLE IF EXISTS `defect_deal`;

CREATE TABLE `defect_deal` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `defectid` varchar(32) NOT NULL COMMENT '缺陷id',
  `dealuser` varchar(32) NOT NULL COMMENT '处理人id',
  `dealtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '处理时间',
  `oldState` varchar(12) DEFAULT NULL COMMENT '操作前状态',
  `newState` varchar(12) NOT NULL COMMENT '操作后状态',
  `nextuser` varchar(32) NOT NULL COMMENT '下一步处理人',
  `remark` varchar(300) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `defectid` (`defectid`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COMMENT='缺陷处理表';

