/*Table structure for table `project` */

DROP TABLE IF EXISTS `project`;

CREATE TABLE `project` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `projname` varchar(100) NOT NULL COMMENT '项目名称',
  `projnum` varchar(100) DEFAULT NULL COMMENT '项目编号',
  `manager` varchar(32) DEFAULT NULL COMMENT '项目负责人',
  `createuser` varchar(32) NOT NULL COMMENT '创建人',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `updateuser` varchar(32) NOT NULL COMMENT '修改人',
  `updatetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `isend` tinyint(3) NOT NULL DEFAULT '0' COMMENT '完结标识 0：未完结、1：已完结、2暂停',
  `remark` varchar(300) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `projname` (`projname`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='项目信息表';

/*Data for the table `project` */

insert  into `project`(`id`,`projname`,`projnum`,`manager`,`createuser`,`createtime`,`updateuser`,`updatetime`,`isend`,`remark`) values (1,'办公自动化系统','PROJ_001','王五','admin','2020-10-31 10:27:05','admin','2020-10-31 10:27:05',0,'办公自动化系统'),(2,'CRM管理系统','PROJ_002','李四','admin','2020-10-31 10:27:38','admin','2020-10-31 10:27:37',0,'CRM管理系统');

/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `username` varchar(32) NOT NULL COMMENT '用户名',
  `password` varchar(64) NOT NULL COMMENT '密码',
  `role` tinyint(3) NOT NULL COMMENT '角色 0：管理员、1：缺陷解决人员、2：缺陷发现人员、3：缺陷确认人员、9：缺陷分析人员',
  `createuser` varchar(32) NOT NULL COMMENT '创建人',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `updateuser` varchar(32) NOT NULL COMMENT '修改人',
  `updatetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `useable` tinyint(3) DEFAULT NULL COMMENT '启用标识 0：停用、1：启用',
  PRIMARY KEY (`username`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

